// The DataFrame fields look pretty good.
// However, the genres and plot_keywords fields take the form:
// genre1|genre2|... and keyword1|keyword2|...
// We will need to separate them out somehow.
// First, we'll look at the distinct genres and keywords.
val genres = df.select("genres")
    .flatMap(row => row.getString(0).split('|'))
    .distinct
    .collect()
genres.length
println("______")
val plotKeywords = df.select("plot_keywords")
    .flatMap(row => row.getString(0).split('|'))
    .distinct
    .collect()
plotKeywords.length

// There are way too many plot keywords, so we won't look at those.
// Instead, let's create binary columns indicating if a movie has a particular genre.
import org.apache.spark.sql.Row
import org.apache.spark.sql.types.{IntegerType, StructType, StructField}
import spark.implicits._
import sqlContext.implicits._

val newRdd = df.rdd.map { row =>
    val oldCols = row.toSeq
    val genresVal = row.getString(row.fieldIndex("genres"))
    val genreCols = genres.map(genre => if (genresVal.contains(genre)) 1 else 0)
    Row.fromSeq(oldCols ++ genreCols)
}

val moviesWithGenres = sqlContext.createDataFrame(newRdd, StructType(df.schema ++ 
    StructType(genres.map(g => new StructField(s"genre$g", IntegerType)))
))
moviesWithGenres.registerTempTable("moviesWithGenres")

// Let's print out our schema for the new DataFrame.
// Then we can figure out what we will use as features.
// I'll do exploratory data analysis in Tableau.
moviesWithGenres.schema.foreach(field => println(field.name))

